String.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

library String {
    function equal(string memory str1, string memory str2) public pure returns (bool) {
        // solidity : NOT USE "hello" == "hello"
        // USE : hash1 == hash2

        // "hello" => bytes [ 68 65 6c 6c 6f ]
        // "hello" => bytes [ 68 65 6c 6c 6f ]
        // check length of two word
        // keccak256(bytes [ 68 65 6c 6c 6f ]) => hash(1c8aff950685c2ed4bc3174f3472287b56d9517b9c948127319a09a7a36deac8)
        // keccak256(bytes [ 68 65 6c 6c 6f ]) => hash(1c8aff950685c2ed4bc3174f3472287b56d9517b9c948127319a09a7a36deac8)

        if(bytes(str1).length == bytes(str2).length && keccak256(bytes(str1)) == keccak256(bytes(str2))) {
            return true;
        }
        
        return false;
    }
}

